import React from "react";

function Quiz() {
    return (
      <div className="App">
         <Router>
          <Switch>
            <Route exact path="/" component={App} />
            <Route path="/quiz" component={Quiz} />
          </Switch>
        </Router>
          <div className="container">
                <h4>Quiozzz</h4>
          </div>
      </div>
    );
  }
  
  export default Quiz;
